import React from "react";
import Navbar from "./components/Navbar";
import MapComponent from "./components/Map";

function App() {
  return (
    <div className="h-screen flex flex-col">

      <div className="flex-1 h-screen">
      <Navbar />
        <MapComponent />
      </div>
    </div>
  );
}

export default App;
